script: |
  super -f text -I q13329.spq | sort > q13329.out

inputs:
  - name: q13329.spq
    data: |
      SELECT + + col2 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - ( - - col1 ) BETWEEN + col1 + - col0 * + - ( - + col2 ) * - col1 AND col0 AND 46 * + - 53 IS NULL;
  - name: tab1

outputs:
  - name: q13329.out
    data: |
